from typing import List

def adi_part8(n: int, X: List[List[int]], A: List[List[int]], B: List[List[int]]) -> List[List[int]]:
    return matrix_elemwise_div(
        matrix_elemwise_sub(
            matrix_row_slice(X, 1, n-1),
            matrix_elemwise_mul(
                matrix_row_slice(X, 0, n-2),
                matrix_row_slice(A, 0, n-2)
            )
        ),
        matrix_row_slice(B, 1, n-1)
    )
